import React from 'react'
import FakeSiteBanner from '../components/FakeSiteBanner';

const SupportPage = () => {
    return (
        <div>
            <header>
                <head>
                    <meta charSet='utf-8' />
                    <title>Request Support</title>
                </head>
            </header>
            <FakeSiteBanner />
    </ div>
  )
}

export default SupportPage
